description:
Printed on quality 50/50 American Apparel, the unisex Stay Up tee will serve as your reminder to stay motivated wherever you are. 

@tryumphathltcs tag print on the back reminds you and those around you where to find us.

Wash and Wear: The print on the Stay Up tee is light and intended to fade slightly over time for a worn-in, vintage appeal!

